.second-wrapper {
  width: 125px;
  background-color: rgba(234, 237, 241, 1);
  border-right: 1px solid rgba(220, 220, 220, 1);
  margin-bottom: 50px;
  .menu-group {
    .group-name {
      padding-left: 10px;
      height: 50px;
      line-height: 50px;
      background-color: rgba(242, 242, 242, 1);
      border-top: 1px solid rgba(220, 220, 220, 1);
      border-bottom: 1px solid rgba(220, 220, 220, 1);
      font-size: 14px;
      color: #999;
      &:first-child {
        border-top:none;
      }
    }
    .second-item {
      padding-left: 10px;
      height: 40px;
      line-height: 40px;
      font-size: 12px;
      color: #666;
      cursor: pointer;
      &.active {
        background: #fff;
      }
    }
  }
}
